export const getSize = ( size ) => {
    const sizes = [
        'fa-xs',
        'fa-sm',
        'fa-lg',
        'fa-2x',
        'fa-3x',
        'fa-5x',
        'fa-7x',
        'fa-10x'
    ]
    return sizes[size - 1]
}

export const inRibbon = target => {
    return blockLocation( target ) === 'wp-blocks/ribbon-content' ? true : false
}

export const inCallout = target => {
    return blockLocation( target ) === 'wp-blocks/ribbon-callout' ? true : false
}

