function blockLocation( target ){
    const { select } = wp.data,
    blocks = select( 'core/block-editor' ).getBlocks(),
    names = blocks.map( block => block.name )

    if( !names.includes( 'wp-blocks/ribbon' ) ) return false
    let location = ''
    blocks.forEach( function( block ) {
        if( block.name !== 'wp-blocks/ribbon' ) return

        location = ribbonRecursion( target, block )
    })

    return location 
}

function ribbonRecursion( target, parent ) {
    if( !parent.innerBlocks ) return

    for( var i = 0; i < parent.innerBlocks.length; i++ ){
        const block = parent.innerBlocks[i]
        
        if( block.clientId === target ) {
            return parent.name
        } else if ( block.innerBlocks ){
            return ribbonRecursion( target, block )
        } else {
            return false
        }
    }
}

